import math

def filter_divisible_numbers(numbers):
    """"""
    filtered_list = []
    for number in numbers:
        is_divisible = False
        for i in range(2, int(math.sqrt(number)) + 1):
            if number % i == 0:
                is_divisible = True
                break
        if not is_divisible:
            filtered_list.append(number)
    return filtered_list
